#!/bin/bash

if [[ -z $1 ]]
then
  echo "no api endpoint supplied as script parameter. defaulting to hardcoded version"
  API_ENDPOINT="https://tn30dnepf3.execute-api.eu-central-1.amazonaws.com/api/fiscalismia/upload/food_item_img"
else
  API_ENDPOINT=$1
fi

curl "$API_ENDPOINT" \
  -X POST \
  -H 'User-Agent: Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:133.0) Gecko/20100101 Firefox/133.0' \
  -H 'Accept: text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8' \
  -H 'Accept-Language: en-US,en;q=0.5' \
  -H 'Accept-Encoding: gzip, deflate, br, zstd' \
  -H 'Connection: keep-alive' \
  -H 'Upgrade-Insecure-Requests: 1' \
  -H 'Sec-Fetch-Dest: document' \
  -H 'Sec-Fetch-Mode: navigate' \
  -H 'Sec-Fetch-Site: cross-site' \
  -H 'Sec-Fetch-User: ?1' \
  -H 'DNT: 1' -H 'Sec-GPC: 1' -H 'Priority: u=0, i' -H 'Origin: null' -H 'Pragma: no-cache' -H 'Cache-Control: no-cache' \
  --data-raw ''